// HasIssuedCertificate applies the HasEdge predicate on the "issued_certificate" edge.
func HasIssuedCertificate() predicate.CertificateRenewal {
	return predicate.CertificateRenewal(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, false, IssuedCertificateTable, IssuedCertificateColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasIssuedCertificateWith applies the HasEdge predicate on the "issued_certificate" edge with a given conditions (other predicates).
func HasIssuedCertificateWith(preds ...predicate.IssuedCertificate) predicate.CertificateRenewal {
	return predicate.CertificateRenewal(func(s *sql.Selector) {
		step := newIssuedCertificateStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.CertificateRenewal) predicate.CertificateRenewal {
	return predicate.CertificateRenewal(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.CertificateRenewal) predicate.CertificateRenewal {
	return predicate.CertificateRenewal(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.CertificateRenewal) predicate.CertificateRenewal {
	return predicate.CertificateRenewal(sql.NotPredicates(p))
}
